import React from 'react';
import Button from '@mui/material/Button';
import Avatar from '@mui/material/Avatar'

function handleEventsDiscovery() { }

function HomePage() {
    return (
        <>
            <main style={{ padding: '0 20px', backgroundColor: '#f2f2f2', minHeight: '100vh', display: 'flex', flexDirection: 'column', justifyContent: 'center', alignItems: 'center' }}>
                <div style={{ textAlign: 'center', color: '#333', fontFamily: 'Montserrat, sans-serif', display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
                    <Avatar
                        style={{
                            justifyContent: 'center',
                            height: '100px',
                            width: '100px',
                            background: '#9C27B0',
                            fontSize: '3 rem'
                        }}>
                        H
                    </Avatar>
                    <h1 style={{ fontWeight: 'bold' }}>Welcome to the Home Page! NAME HERE</h1>
                    <h2>You have successfully logged in!</h2>
                    <p>Feel free to enjoy the following fun features!</p>
                    <br />



                </div>
                <div style={{ display: 'flex', flexDirection: 'row', gap: '20px' }}>
                    <Button
                        variant='outlined'
                        style={{
                            fontSize: '1.7rem',
                            borderRadius: '50px',
                            fontFamily: 'Montserrat, sans-serif',
                            color: '#3900FF',
                            borderColor: '#3900FF'
                        }}
                        onClick={handleEventsDiscovery}
                    >
                        Events Discovery
                    </Button>
                    <Button
                        variant='outlined'
                        style={{
                            fontSize: '1.7rem',
                            borderRadius: '50px',
                            fontFamily: 'Montserrat, sans-serif',
                            color: '#D900FF',
                            borderColor: '#D900FF'
                        }}
                        onClick={handleEventsDiscovery}
                    >
                        Messages
                    </Button>
                    <Button
                        variant='outlined'
                        style={{
                            fontSize: '1.7rem',
                            borderRadius: '50px',
                            fontFamily: 'Montserrat, sans-serif',
                            color: '#9C27B0',
                            borderColor: '#9C27B0'
                        }}
                        onClick={handleEventsDiscovery}
                    >
                        Job Openings
                    </Button>
                    <Button
                        variant='outlined'
                        style={{
                            fontSize: '1.7rem',
                            borderRadius: '50px',
                            fontFamily: 'Montserrat, sans-serif',
                            color: '#FF0097',
                            borderColor: '#FF0097'
                        }}
                        onClick={handleEventsDiscovery}
                    >
                        Connections
                    </Button>
                </div>
            </main>

        </>
    );
}

export default HomePage;
